import React from 'react';
import './Results.css';

const Results = ({ scores }) => {
    return (
        <div className="results-container">
            <h2>Your Results</h2>
            <p>Stress Level: {scores.stress}</p>
            <p>Anxiety Level: {scores.anxiety}</p>
            <p>Depression Level: {scores.depression}</p>
            <p>
                <strong>Note:</strong> If you feel that you need immediate help, please contact a mental health professional.
            </p>
        </div>
    );
};

export default Results;
